@keyframes spinBody {
  0% {
    transform: rotate(0deg) scale(1, 1.1);
  }
  25% {
    transform: rotate(-5deg) scale(1.1, 1);
  }
  50% {
    transform: rotate(0deg) scale(1, 1);
  }
  75% {
    transform: rotate(5deg) scale(1.1, 1);
  }
  100% {
    transform: rotate(0deg) scale(1, 1.1);
  }
}

@keyframes shake {
  0% { left: -3px; top: -3px; }
  25% { left: 3px; top: -3px; }
  50% { left: 3px; top: 3px; }
  75% { left: -3px; top: 3px; }
  100% { left: -3px; top: -3px; }
}

/* reset */
.profile-avatar,
a[href="/users/11144"] > span > span,
img[src="https://avatars.slack-edge.com/2025-06-22/9085312734788_56643e9701ec15c464e7_original.jpg"],
div.card-with-gradient:nth-child(2) > div:nth-child(1) > div:nth-child(1) > div:nth-child(1) > span:nth-child(2),
p.text-\[\#4a2d24\]:nth-child(1),
div[data-viewable-type="Devlog"] > div:nth-child(2) > div:nth-child(2) img
{ display: none; }

img {
  filter: invert();
}

div.card-with-gradient:nth-child(2) > div:nth-child(1) > div:nth-child(1) > div:nth-child(1)::after {
  content: "3";
}

/* rebuild individual images */
.profile-header::before {
  width: calc(var(--spacing)*24);
  height: calc(var(--spacing)*24);
  
  margin-left: auto;
  margin-right: auto;
  margin-bottom: 1rem;
}

div[data-viewable-type="Devlog"] > div:nth-child(2) > div:nth-child(2)::after {
  content: "";
  display: block;
  width: 281px;
  height: 498px;
  cursor: pointer;
  border-radius: 10px;
  filter: invert();
  background: url("https://c.tenor.com/NVP2kRD7CHsAAAAd/tenor.gif");
}

div[data-viewable-type="Devlog"] > div.flex.items-center.justify-between > div.flex.items-center::before {
  width: calc(var(--spacing)*8);
  height: calc(var(--spacing)*8);

  margin-right: 10px;
}

.items-start > div:nth-child(1) img {
  display: block;
}

/* common profile img src */
div[data-viewable-type="Devlog"] > div.flex.items-center.justify-between > div.flex.items-center::before,
.items-start > div:nth-child(1)::before,
.profile-header::before {
  content: "";
  display: block;
  background-image: url("https://avatars.slack-edge.com/2024-10-26/7934206296214_7be35073eff88c2252bc_original.png");
  background-size: cover;
  background-position: center;
  border-radius: 100%;
}

a[href="/users/11144"]::before {
  content: "not nora";
  color: deeppink;
  font-family: Comic Sans MS;
}

a[href="/users/11144"]::after {
  content: "";
  display: inline-block;

  position: relative;
  top: 5px;
  left: -8px;

  width: 20px;
  height: 20px;

  background-image: url("/assets/verified-b3645c3c.png");
  background-size: cover;
  background-position: center;

  cursor: help;
}

div.gap-2::after {
  content: "";
  position: relative;

  display: inline-flex;
  align-items: center;
  justify-content: center;

  height: calc(var(--spacing)*12);
  width: calc(var(--spacing)*12);

  border-style: var(--tw-border-style);
  border-width: 2px;
  border-color: var(--color-blue-500);

  background-image: url("/assets/verified-b3645c3c.png");
  background-size: 20px 20px;
  background-repeat: no-repeat;
  background-position: center;
  background-color: color-mix(in oklab, var(--color-blue-500) 10%, transparent);

  cursor: help;
}
